import './App.css';
import logo from './PlexTechLogo.png';

function App() {
  return (
    <html>
      <head>
        <title>React Playground</title>
      </head>
      <body>
        <div className='section-one'>
          <span>
            <h1>Welcome to the React Demo for PlexTech Advanced Team, Fall 2022</h1>
            <img src={logo} width='3%' height='70%'/>
          </span>
        </div>
      </body>
    </html>
  );
}

export default App;
